import React, { useContext } from 'react';
import {Button, Image, Text, View} from 'react-native';
import { TouchableOpacity } from 'react-native-gesture-handler';
import { AuthContext } from '../context/AuthContext';
import { ContactStyles, styles } from '../theme/appTheme';


export const ContactScreen = () => {

    const {user, token, logOut} = useContext(AuthContext);

    return (
        <View style={ContactStyles.container}>
            <View style={ContactStyles.avatarContainer}>
                <Image
                    source={{uri: user.img}}
                    style={ContactStyles.avatar}
                />
            </View>
            <Text style={ContactStyles.text}>
                Datos:
            </Text>
            <Text style={ContactStyles.title}>Nombre: {user.nombre}</Text>
            <Text style={ContactStyles.title}>Apellido: {user.apellido}</Text>
            <Text style={ContactStyles.text}>
                Email: {user.email}
            </Text>
            <Text style={ContactStyles.text}>
                Rol: {user.rol}
            </Text>
            <TouchableOpacity style={ContactStyles.button} onPress={() => logOut()}>
                <Text style={ContactStyles.buttonText}>Salir de la seccion</Text>
            </TouchableOpacity>
            <Text style={ContactStyles.title}>{JSON.stringify(user, null, 5)}</Text>
            <Text style={ContactStyles.title}>{token}</Text>
        </View>
    );
};
